    true,nt"url": null,nt"notes": "The Dual-Credit and Exam-Based Courses,
    2003 (FRSS 85), is a study that is part of the Fast Response Survey System (FRSS)
    program; program data is available since 1998-99 at http://nces.ed.gov/surveys/frss/downloads.asp.
    FRSS 85 (http://nces.ed.gov/surveys/frss/) is a cross-sectional survey that collects
    and reports data on key education issues at the secondary level. The study was conducted
    using questionnaires of principals. Schools in September 2003 were sampled. The
    studyufffdufffds response rate was 92 percent. Key statistics produced from FRSS
    85 will provide education policymakers with important baseline information about
    the prevalence and characteristics of dual credit courses.",nt"owner_org":
